import "./TransactionForm.css";

function TransactionForm() {
    return (
        <div className="TransactionBackground">
            <div className="Form">
                <span className="FormTitle">Coin Transfer</span>
                <br></br>
                <hr className="FormDivider"></hr>
                <input
                    type="text"
                    className="inputField"
                    placeholder={<span className="asterisk"></span>}
                ></input>
                <label for="input-text-field">
                    <span class="first-letter">H</span>
                    <span class="second-letter">E</span>
                    <span class="third-letter">L</span>
                    <span class="fourth-letter">L</span>
                    <span class="fifth-letter">O</span>
                </label>
            </div>
        </div>
    );
}

export default TransactionForm;
